import React, { useState, useEffect } from 'react';
import { ChevronUp } from 'lucide-react';
import { Link } from 'react-router-dom';

const Footer: React.FC = () => {
  const [isVisible, setIsVisible] = useState(false);

  const toggleVisibility = () => {
    if (window.pageYOffset > 300) {
      setIsVisible(true);
    } else {
      setIsVisible(false);
    }
  };

  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: 'smooth',
    });
  };

  useEffect(() => {
    window.addEventListener('scroll', toggleVisibility);
    return () => {
      window.removeEventListener('scroll', toggleVisibility);
    };
  }, []);

  return (
    <footer className="bg-[#1E1E1E] text-white py-8 px-4">
      {isVisible && (
        <button
          onClick={scrollToTop}
          className="fixed bottom-4 right-4 text-white p-3 rounded-full transition-all duration-300 z-50"
          aria-label="Scroll to top"
        >
          <ChevronUp size={24} className="text-white" />
        </button>
      )}
      <div className="max-w-[1200px] mx-auto">
        {/* Main sections in row */}
        <div className="flex flex-row justify-between gap-4">
          {/* Solution Section */}
          <div className="min-w-[150px]">
            <h3 className="text-base font-semibold mb-3">Solution</h3>
            <ul className="space-y-1 text-sm">
              <li><Link to="/" className="text-[#007bff] hover:underline">Enterprise App Development</Link></li>
              <li><Link to="/" className="text-[#007bff] hover:underline">Android App Development</Link></li>
              <li><Link to="/" className="text-[#007bff] hover:underline">iOS App Development</Link></li>
            </ul>
          </div>

          {/* Industries Section */}
          <div className="min-w-[150px]">
            <h3 className="text-base font-semibold mb-3">Industries</h3>
            <ul className="space-y-1 text-sm">
              <li><Link to="/" className="text-[#007bff] hover:underline">Healthcare</Link></li>
              <li><Link to="/" className="text-[#007bff] hover:underline">Sports</Link></li>
              <li><Link to="/" className="text-[#007bff] hover:underline">E Commerce</Link></li>
              <li><Link to="/" className="text-[#007bff] hover:underline">Construction</Link></li>
              <li><Link to="/" className="text-[#007bff] hover:underline">Club</Link></li>
            </ul>
          </div>

          {/* Quick Links Section */}
          <div className="min-w-[150px]">
            <h3 className="text-base font-semibold mb-3">Quick Links</h3>
            <ul className="space-y-1 text-sm">
              <li><Link to="/reviews" className="text-[#007bff] hover:underline">Reviews</Link></li>
              <li><Link to="/terms" className="text-[#007bff] hover:underline">Terms & Condition</Link></li>
              <li><Link to="/disclaimer" className="text-[#007bff] hover:underline">Disclaimer</Link></li>
              <li><Link to="/sitemap" className="text-[#007bff] hover:underline">Site Map</Link></li>
            </ul>
          </div>

          {/* Stay Connected Section */}
          <div className="min-w-[200px]">
            <h3 className="text-base font-semibold mb-3">Stay Connected</h3>
            <div className="flex gap-1 mb-4">
              <input 
                type="email" 
                placeholder="Enter Email Address" 
                className="px-2 py-1 text-sm bg-transparent border border-gray-600 rounded w-32"
              />
              <button className="px-2 py-1 text-sm bg-[#007bff] text-white rounded hover:bg-blue-600">
                Subscribe
              </button>
            </div>

            {/* Office Location */}
            <h3 className="text-base font-semibold mb-3">Office Location</h3>
            <div className="space-y-3 text-sm">
              <div>
                <p className="font-medium">Los Angeles</p>
                <p className="text-xs text-gray-400">Office PR 3hr High Tower, New A Ring Road, Los Angeles</p>
              </div>
              <div>
                <p className="font-medium">Delhi</p>
                <p className="text-xs text-gray-400">Office 150B, Behind State Gate Char Bhuja Tower, Station Road, Delhi</p>
              </div>
            </div>
          </div>
        </div>


        {/* Copyright */}
        <div className="text-center text-xs text-gray-400">
          <p>Â© All Rights Reserved 2019-{new Date().getFullYear()}</p>
          <p className="mt-1">Designed by DreamIn</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
